import React from "react";
import { Box, Typography } from "@mui/material";
import CopyrightIcon from '@mui/icons-material/Copyright';

export default function Footer() {
    return (
        <Box mt={3} position="absolute" bottom="0px" sx={{width: "100%", height: "5%"}}>
            <Box sx={{pt: 2, display: "flex", flexDirection: "row"}}>
                <CopyrightIcon sx={{color:"#ff1344", pl: "50%"}} /> 
                <Typography color="#ff1344" sx={{pb: 1, fontWeight: 'bold'}} align="center">
                Geir Ola Tvinnereim 2023
                </Typography>
            </Box>

            <Box />
            <Typography color="#ff1344" sx={{pb: 1, fontWeight: 'bold'}} align="center">
                Geir Ola Tvinnereim 2023
            </Typography>
        </Box>
    );
}//bgcolor: '#b4b4b4'
